import React from 'react';
import './AssetCard.css';

export default function AssetCard(props) {
  const assetData = props.assetData;
  return (
    <div className="ac-wrapper ">
      {assetData.map((asset) => (
        <div>
          <h3>{asset.name}</h3>
        </div>
      ))}
    </div>
  );
}
